			name: "Баския: Взрыв реальности",
			duration: "1ч 42м",
			isLike: false
		},
		{
			cover: `${movie5}`,
			name: "Бег это свобода",
			duration: "1ч 42м",
			isLike: true
		},
		{
			cover: `${movie6}`,
			name: "Книготорговцы",
			duration: "1ч 42м",
			isLike: false
		},
		{
			cover: `${movie7}`,
			name: "Когда я думаю о Германии ночью",
			duration: "1ч 42м",
			isLike: false
		}
	]

	return (
		<>
		  <SearchForm />
		  <MoviesCardList
			movies={saveMoves(movies)}
		  />
		</>
	  )
	}
